import React from "react";
import { Container, Row, Button } from "reactstrap";
import { Navlink, Link } from "react-router-dom";

const nav_links = [
  {
    path: "/home",
    display: "Home",
  },
  {
    path: "/#",
    display: "About",
  },
  {
    path: "/tours",
    display: "Tours",
  },
   
];

const Header = () => {
  return 
  <div className="header">
    <Container></Container>
  </div>
};

export default Header;
